import * as React from 'react';
import { DataGrid } from '@material-ui/data-grid';

function getFullName(params) {
  return `${params.getValue('firstName') || ''} ${
    params.getValue('lastName') || ''
  }`;
}

const columns = [
  { field: 'form_number', headerName: 'Form Number', width: "10%" },
  { field: 'primary_owner', headerName: 'Primary Owner', width: 130 },
  { field: 'ship_type', headerName: 'Ship Type', width: 130 },
  { field: 'proposed_ship_name', headerName: 'Ship Name', width: 130 },
  { field: 'port', headerName: 'Port', width: 130 },
  { field: 'registration_date', headerName: 'Registration Date', width: 130 },
  { field: 'ship_lenght', headerName: 'Ship Length', width: 130 },

];

const rows = 

[
    {   "id": "1",
        "form_number": 13,
        "port": "bababa",
        "primary_owner": "sosuri@ucsc.edu",
        "proposed_ship_name": "testing999",
        "registration_date": "Mon, 30 Nov 2020 00:00:00 GMT",
        "ship_lenght": "111.",
        "ship_type": "testing999"
    }
]

export default function ValueGetterGrid() {
  return (
    <div style={{ height: 400, width: '100%' }}>
      <DataGrid rows={rows} columns={columns} />
    </div>
  );
}
